import { StyleSheet } from "react-native"

export default StyleSheet.create({
    page:{
        borderWidth: 1,
        borderColor: 'black',
    },
    inputs:{
        margin: 5,
        padding: 5,
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'center',
    },
    entrar:{
        backgroundColor: 'white',
        textAlign: 'center',
        width:'100%',
        margin: 5,
        padding: 10
    },
    in:{
        borderWidth: 1,
        borderColor: "#ccc",
        borderRadius: 7,
        margin: 5,
        padding: 10
    }
})
